import { Container, Grid, Typography } from '@mui/material';
import React from 'react';

interface Props{

}
const Banner=(props:Props)=> {
    return (
        <div>
            <Container>
                <Grid container>
                    <Grid item>
                        <Typography style={{height: '90px',width: '319px',
        left: '45px',top: '45px',fontSize: '36px',fontStyle: 'normal',fontWeight: '700',
        lineHeight: '45px',textAlign: 'left',}} variant='h4'>
                            Explore Books on entrepreneurship<br></br>
                            My Library</Typography>
                    </Grid>
                </Grid>
            </Container>
        </div>
    );
}

export default Banner;
